import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';



export default function Header() {
  return (
    <Box>
      <Grid container>
        <Grid xs={3} md={3} lg={3}>
            <p>logo</p>
        </Grid>
        <Grid xs={6} md={6} lg={6}>
            <p>logo</p>
        </Grid>
        <Grid xs={3} md={3} lg={3}>
            <p>logo</p>
        </Grid>
     </Grid>
    </Box>
  );
}
